import {appConstants} from "../constants/constant";


export const applicationsReducer = (state = null, action) => {
    console.log('something: ' + action.payload.data);
    switch(action.type) {
        case appConstants.GET_APPLICATIONS:
            console.log('applicationsReducer: ' + action.payload.data);
            return action.payload.data;
        default:
            return state;
    }
};
